import React from "react";
import "./Project.css";

function Project() {
  return (
    <div className="project-page">
      <div className="project-tables">
        <div className="resource-table">
          {/* Render data from the resource page here */}
          {/* This is a mock structure */}
          <table>
            <thead>
              <tr>
                <th>PROJECT NAME</th>
                <th>PROJECT CODE</th>
              </tr>
            </thead>
            <tbody>{/* Map over your data and render table rows */}</tbody>
          </table>
        </div>

        <div className="project-detail">
          {/* Render additional data specific to the project page here */}
          {/* This is a mock structure */}
          <table>
            <thead>
              <tr>
                <th>PROJECT NAME</th>
                <th>PROJECT CODE</th>
              </tr>
            </thead>
            <tbody>{/* Map over your data and render table rows */}</tbody>
          </table>
        </div>
      </div>
    </div>
  );
}

export default Project;
